<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8" />
<meta name="viewport" content="width=device-width, initial-scale=1.0" />
<title>Cleitinho Bot Premium</title>
<style>
:root {
  --bg:#16172d;
  --primary:#ffffff;
  --accent:#00FFC6;
}
*{box-sizing:border-box;margin:0;padding:0}
body {
  font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
  background:var(--bg);
  display:flex;
  align-items:center;
  justify-content:center;
  height:100vh;
}
.chat-wrapper{
  width:100%;
  max-width:420px;
  height:80vh;
  background:#fff;
  border-radius:16px;
  display:flex;
  flex-direction:column;
  box-shadow:0 8px 24px rgba(0,0,0,.3);
}
.header{display:flex;align-items:center;padding:16px 20px;gap:12px;border-bottom:1px solid #eee}
.header img{width:40px;height:40px;border-radius:50%}
.header h2{font-size:18px;color:#16172d}
.messages{
  flex:1;
  overflow-y:auto;
  padding:20px;
}
.messages::-webkit-scrollbar{width:6px}
.messages::-webkit-scrollbar-thumb{background:#ccc;border-radius:3px}
.msg{
  max-width:80%;
  padding:12px 14px;
  border-radius:12px;
  margin-bottom:10px;
  line-height:1.4;
  font-size:14px;
}
.user{align-self:flex-end;background:var(--accent);color:#16172d}
.bot{align-self:flex-start;background:#f2f2f2;color:#000}
.typing{display:inline-block;width:24px}
.typing span{
  display:inline-block;width:6px;height:6px;margin-right:2px;border-radius:50%;
  background:#aaa;animation:blink 1s infinite;
}
.typing span:nth-child(2){animation-delay:.2s}
.typing span:nth-child(3){animation-delay:.4s}
@keyframes blink{0%,100%{opacity:.2}50%{opacity:1}}
.form{display:flex;padding:12px 20px;border-top:1px solid #eee;gap:8px}
#input{flex:1;padding:12px;border:1px solid #ccc;border-radius:24px;font-size:14px}
#send{background:var(--accent);border:none;width:48px;height:48px;border-radius:50%;display:flex;align-items:center;justify-content:center;cursor:pointer;transition:transform .2s}
#send:hover{transform:scale(1.1)}
#send svg{width:22px;height:22px;fill:#16172d}
@media(max-width:480px){
  .chat-wrapper{height:100vh;border-radius:0;max-width:100%}
}
</style>
</head>

<script>
const messagesEl = document.getElementById('messages');
const form = document.getElementById('form');
const input = document.getElementById('input');
const ping = document.getElementById('ping');
const API_URL = 'https://cleitinho-bot.vercel.app/api/chat'; // TODO replace

// restore history
const history = JSON.parse(sessionStorage.getItem('history')||'[]');
history.forEach(m => addMessage(m.text, m.role,false));
scrollBottom();

form.addEventListener('submit', (e)=>{e.preventDefault(); send()});
input.addEventListener('keydown', (e)=>{ if(e.key==='Enter' && !e.shiftKey){ e.preventDefault(); send(); }});

function addMessage(text,role,save=true){
  const div=document.createElement('div');
  div.className='msg '+(role==='user'?'user':'bot');
  div.textContent=text;
  messagesEl.appendChild(div);
  if(save){
    history.push({text,role});
    sessionStorage.setItem('history',JSON.stringify(history));
  }
  scrollBottom();
}

function scrollBottom(){messagesEl.scrollTop=messagesEl.scrollHeight}

function addTyping() {
  const div=document.createElement('div');
  div.className='msg bot';
  div.id='typing';
  div.innerHTML='<span class="typing"><span></span><span></span><span></span></span>';
  messagesEl.appendChild(div);
  scrollBottom();
}
function removeTyping() {
  const t=document.getElementById('typing');
  if(t) t.remove();
}

async function send() {
  const text=input.value.trim();
  if(!text) return;
  addMessage(text,'user');
  input.value='';
  input.focus();
  addTyping();
  try {
      const res = await fetch(API_URL, {
          method:'POST',
          headers:{'Content-Type':'application/json'},
          body:JSON.stringify({message:text,history})
      });
      if(!res.ok) throw new Error('Falha de rede');
      const data = await res.json();
      removeTyping();
      addMessage(data.answer||'[sem resposta]','bot');
      ping.currentTime=0; ping.play().catch(()=>{});
  } catch(err){
      removeTyping();
      addMessage('Ops! Não consegui me conectar. Tente novamente mais tarde.','bot');
  }
}
</script>
